import SearchBar from '../searchBar/SearchBar';
import './nav.css';
import { Link } from 'react-router-dom';

const Nav = ({ onSearch }) => {
    
    return ( 
        <div>
            <button>home</button>
            <button>about</button>
            <SearchBar onSearch={onSearch} />
        </div>
    )
}

export default Nav;
